create table order_details
(
    order_id varchar(200) PRIMARY KEY ,
    order_date	date not null,
    ship_date	date not null,
    ship_mode	VARCHAR(200) not null,
    
)


create table products
(
     product_id	VARCHAR(200) PRIMARY KEY,
     product_name	VARCHAR(200) not null,
     category	VARCHAR(200) not null,
     sub_category	VARCHAR(200) not null
)


create table customer_region
(
    state	VARCHAR(200)  Primary key,
    region	VARCHAR(200)  not null,
)


create table customer_address
(
    postal_code	INT  PRIMARY KEY,
    state	VARCHAR(200)  FOREIGN KEY REFERENCES customer_region(state) ON DELETE CASCADE ,
    city	VARCHAR(200)  not null
)


create table customer_details
(
    customer_id	VARCHAR(200) PRIMARY KEY,
    customer_name	VARCHAR(200) default('Customer Name') not null,
    segment	VARCHAR(200) not null,
    postal_code	INT FOREIGN KEY REFERENCES customer_address(postal_code) ON DELETE CASCADE
)

create table order_customers
(
    order_id varchar(200) FOREIGN KEY REFERENCES order_details( order_id) ON DELETE CASCADE,
    customer_id VARCHAR(200) FOREIGN KEY REFERENCES customer_details( Customer_id) ON DELETE CASCADE
)

create table order_products
(
    order_id varchar(200) FOREIGN KEY REFERENCES order_details( order_id) ON DELETE CASCADE,
    product_id	VARCHAR(200) FOREIGN KEY REFERENCES products( product_id) ON DELETE CASCADE,
    sales	decimal(10,2) check(sales>0)
)




